'use strict';

/**
* Serializes a complex number as a JSON object.
*
* @private
* @returns {Object} JSON representation
*/
function toJSON() {
	/* eslint-disable no-invalid-this */
	var out = {};
	out.type = 'Complex128';
	out.real = this.real;
	out.imag = this.imag;
	return out;
} // end FUNCTION toJSON()


// EXPORTS //

module.exports = toJSON;
